import React from 'react'
import Card from '../card/Card'

import './product.css'



const Products = () => {
    
    const [items, setitems] = React.useState([{
        "title": "IBANEZ GRX40-BKN",
        "price": "25 399",
        "imageUrl": "img/products/Ibanez.png",
        "category": "Электрогитара"
      },
      {
        "title": "YAMAHA F310 N",
        "price": "20 999",
        "imageUrl": "img/products/Yamaha.png",
        "category": "Акустическая гитара"
      },
      {
        "title": "Belucci BC4010BK",
        "price": "5 499",
        "imageUrl": "img/products/belucci1.png",
        "category": "Акустическая гитара"
      },
      {
        "title": "TAKAMINE G50 SERIES",
        "price": "37 999",
        "imageUrl": "img/products/Takamine1.png",
        "category": "Акустическая гитара"
      },
      {
        "title": "ROCKDALE AURORA D1",
        "price": "9 699",
        "imageUrl": "img/products/Takamine1.png",
        "category": "Акустическая гитара"
      },
      {
        "title": "ROCKDALE AURORA D1",
        "price": "9 699",
        "imageUrl": "img/products/rockdale1.svg",
        "category": "Акустическая гитара"
      },
      {
        "title": "BLUE LAVA ORIGINAL AC",
        "price": "38 999",
        "imageUrl": "img/products/lava1.svg",
        "category": "Акустическая гитара"
      },
      {
        "title": "IBANEZ TCY10E-BK",
        "price": "25 999",
        "imageUrl": "img/products/ibanez2.svg",
        "category": "Акустическая гитара"
      }]);

    return (
    <section className='Products'>
       
        <div className="container">
            
        <span>Популярные товары</span>


            <div className="tovary">
            { items.map((obj) => ( 
                <Card 
                    title={obj.title}
                    price={obj.price}
                    category={obj.category}
                    imageUrl={obj.imageUrl} 
                    onClickAdd = {() => console.log('Добавлено в корзину')}
                />
            ))}
  
            </div>
    
        
        </div>
                
    </section>);
        
}
 


export default Products;
